import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";
import jwt_decode from "jwt-decode";

export default function Login() {
  const navigate = useNavigate();
  const [formValues, setFormValues] = useState({ username: "", password: "" });
  const [formError, setFormError] = useState("");
  const [loading, setLoading] = useState(false); // Define the loading state

  const onChangeHandler = (e) => {
    setFormValues({ ...formValues, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    setLoading(true); // Set loading to true

    axios
      .post(`${apiUrl}/api/token/`, formValues) // Correctly use formValues
      .then((response) => {
        // Handle successful login
        sessionStorage.setItem("access_token", response.data.access);
        sessionStorage.setItem("refresh_token", response.data.refresh);

        // Decode the JWT to extract user information
        const user = jwt_decode(response.data.access);
        const userId = user.user_id;
        const username = user.name;
        const user_type = user.user_type;

        // Set Authorization header for future requests
        axios.defaults.headers.common["Authorization"] = `Bearer ${response.data.access}`;

        // Store user information in session storage
        sessionStorage.setItem("user_id", userId);
        sessionStorage.setItem("name", username);
        sessionStorage.setItem("user_type", user_type);

        // Navigate based on user type
        if (user_type === "admin") {
          navigate("/admin/users");
        } else if (user_type === "vehicle_owner") {
          navigate("/vo/vehicles");
        } else if (user_type === "normal_user") {
          navigate("/user/home"); // Add appropriate route for normal users
        }
      })
      .catch((error) => {
        setLoading(false); // Set loading to false on error
        if (error.response) {
          // If the response was received, handle specific errors
          console.error("Error response data:", error.response.data);
          setFormError(error.response.data.non_field_errors[0] || "An error occurred.");
        } else {
          // Handle unexpected errors
          console.error("Error message:", error.message);
          setFormError("An unexpected error occurred.");
        }
      });
  };

  return (
    <div
      style={{
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "linear-gradient(135deg, #f5f7fa, #c3cfe2)",
      }}
    >
      <div
        className="container mt-5"
        style={{
          width: "450px",
          height: "auto",
          boxShadow: "4px 4px 15px rgba(0, 0, 0, 0.2)",
          backgroundColor: "#ffffff",
          padding: "40px",
          borderRadius: "15px",
          border: "2px solid #007bff",
        }}
      >
        <form onSubmit={onSubmit} className="form">
          <div className="row mt-3 mb-3">
            <h2 className="text-center" style={{ fontSize: "30px", color: "#007bff" }}>
              <i className="bi bi-person-plus px-3"></i>Login
            </h2>
          </div>

          {/* Username */}
          <div style={{ marginBottom: "20px" }}>
            <label
              htmlFor="username"
              style={{ display: "inline-block", width: "150px", textAlign: "right", marginRight: "10px" }}
            >
              Username:
            </label>
            <input
              required
              type="text"
              name="username"
              id="username"
              placeholder="Enter your username"
              className="form-control"
              style={{
                fontSize: "16px",
                padding: "10px",
                border: "1px solid #ccc",
                borderRadius: "8px",
              }}
              onChange={onChangeHandler}
            />
          </div>

          {/* Password */}
          <div style={{ marginBottom: "20px" }}>
            <label
              htmlFor="password"
              style={{ display: "inline-block", width: "150px", textAlign: "right", marginRight: "10px" }}
            >
              Password:
            </label>
            <input
              required
              type="password"
              name="password"
              id="password"
              placeholder="Enter your password"
              className="form-control"
              style={{
                fontSize: "16px",
                padding: "10px",
                border: "1px solid #ccc",
                borderRadius: "8px",
              }}
              onChange={onChangeHandler}
            />
          </div>

          {/* Error message */}
          <p className="text-danger" style={{ fontSize: "14px", marginBottom: "20px" }}>
            {formError}
          </p>

          {/* Registration link */}
          <p style={{ fontSize: "14px", textAlign: "center", marginBottom: "20px" }}>
            New User?{" "}
            <a href="register" style={{ color: "#007bff", textDecoration: "none" }}>
              Register here
            </a>
          </p>

          {/* Submit button */}
          <div className="row mb-3">
            <div className="col text-center">
              <button
                className="btn btn-dark"
                style={{
                  width: "50%",
                  fontSize: "18px",
                  padding: "10px 20px",
                  backgroundColor: "#007bff",
                  border: "none",
                  borderRadius: "8px",
                }}
                disabled={loading} // Disable the button while loading
              >
                {loading ? "Logging in..." : "Login"}
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}
